import React from "react";
import './MapTimeline.css'
import { Link } from 'react-router-dom'

const TimelineAsia19 = () => {
    return(
        <>
            <h1 className="title">Asia</h1>
            <div className="verticalLine"/>
            <div className="horizontalLineOne"/>
            <div className="horizontalLineTwo"/>
            <Link to='/Asia-1750' className='ButtonOne'>
                1750-1865
            </Link>
            <Link to='/Asia-1865' className='ButtonTwo'>
                1865-1910
            </Link>
        </>
    );
}

const TimelineAsia20 = () => {
    return(
        <>
            <h1 className="title">Asia</h1>
            <div className="verticalLine"/>
            <div className="horizontalLineOne"/>
            <div className="horizontalLineTwo"/>
            <Link to='/Asia-1865' className='ButtonOne'>
                1865-1910
            </Link>
            <Link to='/Asia-1910' className='ButtonOne'>
                1910-1920
            </Link>
            <Link to='/Asia-1920' className='ButtonTwo'>
                1920-1930
            </Link>
        </>
    );
}

const MapTimelineAsia = ({Century}) => {
    return (
        <div className="miniTimeline">
            {Century === 19 && <TimelineAsia19/>}
            {Century === 20 && <TimelineAsia20/>}
        </div>
    );
}

export default MapTimelineAsia;
